  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The data provided here include hospital-specific
  charges for the more than 3,000 U.S. hospitals that receive Medicare Inpatient Prospective
  Payment System (IPPS) payments for the top 100 most frequently billed discharges,
  paid under Medicare based on a rate per discharge using the Medicare Severity Diagnosis
  Related Group (MS-DRG) for Fiscal Year (FY) 2011, 2012, and 2013. These DRGs represent
  more than 7 million discharges or 60 percent of total Medicare IPPS discharges.</p>n\",\n\t\"license_title\":
